import React from 'react';
import './App.css';
import Practise from './Person/Person';

function App() {
  return (
    <div className="App">
      <h1>Hello People!</h1>
      <h2>Myseld</h2>
      <Practise name="Max" age="27">I like to swim.</Practise>
    </div>
  );
}

export default App;
